import './App.css';

import Links from "./components/Links";
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/react-toastify.css';

function App() {
  return (
    <>
      <div className='container p-4'>
        <div className='row'>
          <ToastContainer />
          <Links />
        </div>

      </div>
    </>
  );
}

export default App;
